import React from 'react'
import { motion } from 'framer-motion'
import { defaultTransition, pageTransition,secondDefaultTransition } from '../PageTransitions'
function RestaurantsListScreen() {



    return (
        <motion.div
            initial={secondDefaultTransition.out}
            animate={defaultTransition.in}
            exit={defaultTransition.out}
            transition={pageTransition}
            variants={defaultTransition}
        >
            <h1>Restaurants list</h1>
        </motion.div>
    )
}

export default RestaurantsListScreen
